import keras
import numpy as np
from keras.models import Sequential
from keras.layers import Dense, LSTM
from keras.utils import np_utils

np.random.seed(5)

class LossHistory(keras.callbacks.Callback):
    def init(self):
        self.losses = []
    def on_epoch_end(self,batch,logs={}):
        self.losses.append(logs.get('loss'))
          
def seq2dataset(um,octa,seig,socdo,window_size):
    dataset_X = []
    dataset_Y = []

    for i in range(len(um)-window_size):
        subset = um[i:(i+window_size)]+octa[i:(i+window_size)]+segi[i:(i+window_size)]+socdo[i:(i+window_size)]
        subset2 = um[window_size] + octa[window_size] + segi[window_size] + socdo[window_size]
        
        for si in range(len(subset)):
            features = subset[si]
            dataset_X += (features)
        
        dataset_Y.append(subset2)
        
    return np.array(dataset_X), np.array(dataset_Y)

#x_train, y_train = seq2dataset(um,octa,segi,socdo,window_size=20)
x_train, y_train = seq2dataset(um,octa,segi,socdo, window_size=4)

x_train = np.reshape(x_train,(679,4,20))

y_train = np_utils.to_categorical(y_train)

y_train = np.reshape(y_train,(679,20*65))
one_hot_vec_size = y_train.shape[1]

print("one hot encoding vector size is ", one_hot_vec_size)

#model
model = Sequential()
model.add(LSTM(500, batch_input_shape = (1,4,20), stateful=True))
model.add(Dense(one_hot_vec_size, activation='softmax'))

#
model.compile(loss='categorical_crossentropy',optimizer='adam', metrics=['accuracy'])

# 
num_epochs = 1

history = LossHistory()
history.init()

for epoch_idx in range(num_epochs):
    print('epochs : ' + str(epoch_idx))
    model.fit(x_train, y_train, epochs = 1, batch_size=1,verbose=2,shuffle=False,
              callbacks=[history])
    model.reset_states()
    
# 
#matplotlib inline
import matplotlib.pyplot as plt

plt.plot(history.losses)
plt.ylabel('loss')
plt.xlabel('epochs')
plt.legend(['train'], loc='upper left')
plt.show()

# 
scores = model.evaluate(x_train, y_train, batch_size=1)
print("%s: %.2f%%" %(model.metrics_names[1], scores[1]*100))
model.reset_states()

pred_count = 679

# 
seq_out = []
for i in range(4):
    seq_out += um[i]
    seq_out += octa[i]
    seq_out += segi[i]
    seq_out += socdo[i]
pred_out = model.predict(x_train, batch_size=1)
pred_out = np.reshape(pred_out,(679,20,65))

for i in range(pred_count):
    for j in range(len(pred_out[i])):
        idx = np.argmax(pred_out[i][j])
        seq_out.append(idx)
print('one step prediction : ', seq_out)

model.reset_states()

#  
seq_in = []
for i in range(4):
    seq_in += um[i]
    seq_in += octa[i]
    seq_in += segi[i]
    seq_in += socdo[i]
seq_out = seq_in

seq_in_featrues=[]

for si in seq_in:
    features = si
    seq_in_featrues.append(features)

for i in range(pred_count):
    sample_in = np.array(seq_in_featrues)
    sample_in = np.reshape(sample_in, (1,4,20))
    pred_out = model.predict(sample_in)
    pred_out = np.reshape(pred_out,(1,20,65))
    for j in range(len(pred_out[0])):
            idx = np.argmax(pred_out[0][j])
            seq_out.append(idx)    
            features = idx
            seq_in_featrues.append(features)
            seq_in_featrues.pop(0)
    
model.reset_states()

print('full song prediction : ', seq_out)